import axios from "axios";
import Footer from "./Footer";
import Header from "./Header";

export default function Main() {
  const URL = "http://localhost:4000/pet/get";
  axios
    .get(URL)
    .then((response) => {
      const { data } = response;
      console.log(data);
    })
    .catch((err) => console.log(err.response));
  return (
    <>
      <Header />
      <Footer />
    </>
  );
}
